import React from 'react';
import PropTypes from 'prop-types';
Testa.propTypes  = {
  tit : PropTypes.string,
};

const Testa= (props) =>{
  const {tit} = props;
    return (
        <div className="taskItem">
        <label> Title {tit} </label>
        <label> Creator</label>
        <label> Status</label>
        <p>
          Desscription: <br />
        </p>
      </div>

    )
};


export default Testa;
